import React from 'react';
import './Home.css';
import Logo from './Logo';

export default function Home() {
  return (
    <div style={{position: 'relative', minHeight: '70vh'}}>
      <div style={{position: 'absolute', top: 32, left: 32, zIndex: 10}}>
        <Logo />
      </div>
      <section className="hero-section">
        <img src="/images/hero.jpg" alt="G TECHNIC AI Assistant" className="hero-image" />
        <div className="hero-overlay">
          <h1>Endüstriyel Geleceğinizi Şekillendirin</h1>
          <p>Yapay zeka destekli endüstriyel çözümlerle tanışın.</p>
        </div>
      </section>
    </div>
  );
}
